import React from "react";
import Card from "../Card";
import Contacts from "../contacts";


function App() {
    return (
        <div>
            <h1 className="heading">My Contacts</h1>
            {Contacts.map((contact) => 
                <Card 
                    name={contact.name}
                    img={contact.imgURL}
                    phone={contact.phone}
                    email={contact.email}
                />
            )}
           
        </div>
    )
}
export default App;
